import React from 'react';

function App() {
  return (
    <div>
   <h1>
    안녕하세요, 저는 아기사자입니다!
   </h1>
   <p>
    저는 프론트엔드 개발자를 꿈꾸고 있습니다. 
   </p>
   </div>
  );
}

export default App;
